import React, { useState } from "react";
import Hello from "./module";
import Card from "./Card";
import Temp from "./Temp";

const App = () => {
   return (
      <div>
         <Temp>
            <Card number1="1" number2="2"></Card>
            <Hello item="hello"></Hello>
         </Temp>
      </div>
   );
};

export default App;
